router.put('/status',
    async(req, res) => {
        try {
            const {users} = req.body;
            users.map(async (item) => {
                email = item.email
                const user = await User.findOne({email})
                user.type = item.type;
                await user.save();
            })
            return res.json({message: "Statuses were changed successfully!"});
        } catch (error) {
            res.send({message: 'Server error'});
        }
});

